import React from 'react';
import ReactDOM from 'react-dom';

function getDays(){
    fetch('192.168.10.104:5000/love')
    .then(function(response){
        console.log(response.json() + "foo");
        return JSON.stringify(response.json());
        });
}
console.log(getDays());
